//用于翻译手套传来数据的三个函数
function ED(Arr1, Arr2) {
  var result = 0;
  var t;
  for (var i = 0; i < Arr1.length; i++) {
    t = Arr1[i] - Arr2[i];
    result += t * t;
  }
  result = Math.sqrt(result, 2);
  //强制类型转换减少运算量，可以尝试
  return parseInt(result);
}

function get_dtw_cost2(nums1, nums2) {
  var i, j;
  var m1 = nums1.length;
  var m2 = nums2.length;
  var D = new Array(m1);
  for (i = 0; i < m1; i++) {
    D[i] = Array(m2);
  }

  var dist_mat = [];
  for (i = 0; i < m1; i++) {
    dist_mat[i] = [];
    for (j = 0; j < m2; j++) {
      dist_mat[i][j] = ED(nums1[i], nums2[j]);
    }
  }

  D[0][0] = 2 * dist_mat[0][0];
  for (i = 1; i < m1; i++) {
    D[i][0] = dist_mat[i][0] + D[i - 1][0];
  }
  for (j = 1; j < m2; j++) {
    D[0][j] = dist_mat[0][j] + D[0][j - 1];
  }

  for (i = 1; i < m1; i++) {
    for (j = 1; j < m2; j++) {
      D[i][j] = Math.min((dist_mat[i][j] + Math.min(D[i - 1][j], D[i][j - 1])), 2 * dist_mat[i][j] + D[i - 1][j - 1]);
      //~ 无法计算上一步

    }
  }

  //~ return [D,D[m1-1][m2-1]];这是与python相同的结果
  return D[m1 - 1][m2 - 1];
}

function get_flag(array1, dict_center) {
  var i = 0;
  var rand = [];
  var array2 = [];
  array2 = array1.slice(0,5)
  for (var key in dict_center) {
    rand = rand.concat(get_dtw_cost2(array2, dict_center[key]));
  }

  return rand.indexOf(Math.min.apply(Math, rand));
}

