function search_k(target) {
  var cost_new = 0;
  var cost_old = 10000000;
  var cost_old2 = 10000000;
  var pution_name = '1';
  var name_nd;
  var name;
  var target_flag = get_flag(target, center_dict);//与中心点对比，确定目标簇群
  var target_list = name_dict[target_flag];//获取簇群中对应的匹配列表

  for (var i in target_list)//i返回的是0，1，2，3，4
  {
    name = target_list[i];
    cost_new = get_dtw_cost2(target, all_dict[name]);
    if (cost_new < cost_old) {
      cost_old2 = cost_old;
      cost_old = cost_new;
      name_nd = pution_name;
      pution_name = name;
    }
    else {
      if (cost_new < cost_old2) {
        cost_old2 = cost_new;
        name_nd = name;
      }
    }

  }
  return pution_name;
}	

